import React, { useState } from 'react';
import Calendar from 'react-calendar';
import '../../';

// import 'react-calendar/dist/Calendar.css';


function App() {
  const [value, onChange] = useState(new Date());

  return (
    <div>
       <Calendar
        onChange={onChange}
        value={value}
      />
    </div>
  );
}

export default App;
